export const initialState = {
  mainPosts: [
    {
      id: 1,
      User: {
        id: 1,
        nickname: "삭은이",
        content: "첫번째 게시글 #태그",
        Images: [
          {
            src: "https://m.londonslacks.com/web/product/big/201907/ece0ec037ccc8d580daaa51701b90b7a.jpg",
          },
        ],
        Comments: [{
          User: {
            nickname: 'nero'
          }
        }]
      },
    },
  ],
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    default:
      return state;
  }
};

export default reducer;
